import React from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import { AuthProvider, useAuth } from "./contexts/AuthContext";


import Login from "./pages/Auth/Login";
import Cadastro from "./pages/Auth/Cadastro";
import DashboardIdoso from "./pages/Dashboard/DashboardIdoso";
import DashboardFamiliar from "./pages/Dashboard/DashboardFamiliar";
import DashboardAdmin from "./pages/Dashboard/DashboardAdmin";
import ListaDesejos from "./pages/Idoso/ListaDesejos";
import NotificacoesIdoso from "./pages/Idoso/NotificacoesIdoso";
import IdososAcompanhados from "./pages/Familiar/IdososAcompanhados";
import Mensagens from "./pages/Familiar/Mensagens";
import GerenciarIdosos from "./pages/Admin/GerenciarIdosos";
import GerenciarFamiliares from "./pages/Admin/GerenciarFamiliares";
import Logs from "./pages/Admin/Logs";
import NotificacoesAdmin from "./pages/Admin/NotificacoesAdmin";
import Configuracoes from "./pages/Config/Configuracoes";


function ProtectedRoute({ children, role }) {
    const { user } = useAuth();
    if (!user) return <Navigate to="/" />;
    if (role && user.tipo !== role) return <Navigate to="/" />;
    return children;
}


export default function App() {
    return (
        <BrowserRouter>
            <AuthProvider>
                <Routes>
                    <Route path="/" element={<Login />} />
                    <Route path="/auth/cadastro" element={<Cadastro />} />


                    <Route path="/idoso/dashboard" element={<ProtectedRoute role="IDOSO"><DashboardIdoso /></ProtectedRoute>} />
                    <Route path="/idoso/lista-desejos" element={<ProtectedRoute role="IDOSO"><ListaDesejos /></ProtectedRoute>} />
                    <Route path="/idoso/notificacoes" element={<ProtectedRoute role="IDOSO"><NotificacoesIdoso /></ProtectedRoute>} />


                    <Route path="/familiar/dashboard" element={<ProtectedRoute role="FAMILIAR"><DashboardFamiliar /></ProtectedRoute>} />
                    <Route path="/familiar/idosos" element={<ProtectedRoute role="FAMILIAR"><IdososAcompanhados /></ProtectedRoute>} />
                    <Route path="/familiar/mensagens" element={<ProtectedRoute role="FAMILIAR"><Mensagens /></ProtectedRoute>} />


                    <Route path="/admin/dashboard" element={<ProtectedRoute role="ADMIN"><DashboardAdmin /></ProtectedRoute>} />
                    <Route path="/admin/idosos" element={<ProtectedRoute role="ADMIN"><GerenciarIdosos /></ProtectedRoute>} />
                    <Route path="/admin/familiares" element={<ProtectedRoute role="ADMIN"><GerenciarFamiliares /></ProtectedRoute>} />
                    <Route path="/admin/logs" element={<ProtectedRoute role="ADMIN"><Logs /></ProtectedRoute>} />
                    <Route path="/admin/notificacoes" element={<ProtectedRoute role="ADMIN"><NotificacoesAdmin /></ProtectedRoute>} />


                    <Route path="/config" element={<ProtectedRoute><Configuracoes /></ProtectedRoute>} />
                </Routes>
            </AuthProvider>
        </BrowserRouter>
    );
}
